import React from 'react';
import {Card} from "react-bootstrap";
import Menu from "./Menu";
import UnderMenu from "./UnderMenu";
import Mails from "./Mails";

const Interface = () => {
    return (
        <Card>
            <Card.Header>
                <Menu/>
            </Card.Header>
            <Card.Body>
                <Card.Title>
                    <UnderMenu/>
                </Card.Title>
                <Mails/>
            </Card.Body>
        </Card>
    );
};

export default Interface;
